import React, { useEffect, useState } from "react";
import axios from 'axios';
import Table from 'react-bootstrap/Table';
import "./alldoctor.css" 
import Button from 'react-bootstrap/Button';

const AllDoctor = () => {
  const [doctors, setDoctors] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8800/api/doctor/getdoctor') // Replace with your API endpoint
      .then(response => {
        setDoctors(response.data);
      })
      .catch(error => {
        console.error('Error fetching doctors:', error);
      });
  }, []);

  return (
    <>
    <div className="tableplacement">
      <Table striped bordered hover size="sm">
        <thead>
          <tr className="text-center">
            <th>No</th>
            <th>Username</th>
            <th>Date of Birth</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Category</th>
            <th>Edit</th>
          </tr>
        </thead>
        <tbody>
          {doctors.map((doctor, index) => (
            <tr key={doctor._id}>
              <td>{index + 1}</td>
              <td>{doctor.username}</td>
              <td>{new Date(doctor.dateofbirth).toLocaleDateString()}</td>
              <td>{doctor.email}</td>
              <td>{doctor.phone}</td>
              <td>{doctor.category}</td>
              <td className="text-center"><Button variant="outline-success">Edit</Button></td>
            </tr>
          ))}
        </tbody>
      </Table>
      </div>
    </>
  );
};

export default AllDoctor;
